func (w *WalletRepo) FindMultiByIDS(ctx context.Context, IDS []string) ([]*fkratos_wallet_model.Wallet, error) {
	dao := fkratos_wallet_dao.Use(w.db).Wallet
	result, err := dao.WithContext(ctx).Where(dao.ID.In(IDS...)).Find()
	if err != nil {
		return nil, err
	}
	return result, nil
}

// FindMultiByPaginator 查询分页数据(通用)
func (w *WalletRepo) FindMultiByPaginator(ctx context.Context, paginatorReq *orm.PaginatorReq) ([]*fkratos_wallet_model.Wallet, *orm.PaginatorReply, error) {
	result := make([]*fkratos_wallet_model.Wallet, 0)
	var total int64
	whereExpressions, orderExpressions, err := paginatorReq.ConvertToGormExpression(fkratos_wallet_model.Wallet{})
	if err != nil {
		return nil, nil, err
	}
	err = w.db.WithContext(ctx).Model(&fkratos_wallet_model.Wallet{}).Select([]string{"*"}).Clauses(whereExpressions...).Count(&total).Error
	if err != nil {
		return result, nil, err
	}
	if total == 0 {
		return result, nil, nil
	}
	paginatorReply := paginatorReq.ConvertToPage(int(total))
	err = w.db.WithContext(ctx).Model(&fkratos_wallet_model.Wallet{}).Limit(paginatorReply.Limit).Offset(paginatorReply.Offset).Clauses(whereExpressions...).Clauses(orderExpressions...).Find(&result).Error
	if err != nil {
		return result, nil, err
	}
	return result, paginatorReply, err
}
